css:
atom-text-editor,
:host {
  background-color: #ffffff;
  color: #1c1d21;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #cbcdd2;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #ececee;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #cbcdd2;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #ffffff;
  color: #686b78;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #e6e7ea;
  color: #848794;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #848794;
}
atom-text-editor .gutter .line-number.line-diff-modified,
:host .gutter .line-number.line-diff-modified,
atom-text-editor .gutter .line-number.line-diff-added,
:host .gutter .line-number.line-diff-added {
  color: white;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #848794;
}
atom-text-editor .invisible,
:host .invisible {
  color: #1c1d21;
}
atom-text-editor .cursor,
:host .cursor {
  color: #3aabd4;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #f4f4f6;
}
.atom-text-editor .line.highlight-line,
:host .line.highlight-line,
atom-text-editor .line.highlight-line,
atom-text-editor::shadow .line.highlight-line {
  background: rgba(200, 200, 200, 0.2) !important;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #444444;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #a2a5ae;
}
.entity.name.type {
  color: #848794;
}
.entity.other.inherited-class {
  color: #848794;
}
.keyword {
  color: #78bd65;
}
.keyword.control {
  color: #78bd65;
}
.keyword.operator {
  color: #eb3d54;
}
.keyword.other.special-method {
  color: #ef7c2a;
}
.keyword.other.unit {
  color: #ef7c2a;
}
.keyword.other.use {
  color: #eb3d54;
}
.keyword.other.namespace {
  color: #eb3d54;
}
.storage {
  color: #78bd65;
}
.storage.type {
  color: #cbcdd2;
}
.storage.type.class {
  color: #78bd65;
}
.storage.type.function {
  color: #78bd65;
}
.storage.type.var {
  color: #eb3d54;
}
.storage.modifier {
  color: #eb3d54;
}
.constant {
  color: #ef7c2a;
}
.constant.character.escape {
  color: #ef7c2a;
}
.constant.numeric {
  color: #ef7c2a;
}
.constant.other.color {
  color: #ef7c2a;
}
.constant.other.symbol {
  color: #78bd65;
}
.variable {
  color: #9a9da7;
}
.variable.interpolation {
  color: #eb3d54;
}
.variable.parameter.function {
  color: #1c1d21;
}
.invalid.illegal {
  background-color: #eb3d54;
  color: #ffffff;
}
.string {
  color: #4fb4d8;
}
.string.regexp {
  color: #ef7c2a;
}
.string.regexp .source.ruby.embedded {
  color: #eb3d54;
}
.string.other.link {
  color: #eb3d54;
}
.punctuation.definition.comment {
  color: .comment;
}
.punctuation.definition.string {
  color: .string;
}
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #1c1d21;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #ef7c2a;
}
.punctuation.definition.bold {
  color: #eb3d54;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #eb3d54;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #848794;
}
.support.class {
  color: #848794;
}
.support.function {
  color: #eb3d54;
}
.support.function.any-method {
  color: #c1a101;
}
.entity.name.function {
  color: #c1a101;
}
.entity.name.class,
.entity.name.type.class {
  color: #848794;
}
.entity.name.section {
  color: #ef7c2a;
}
.entity.name.tag {
  color: #eb3d54;
}
.entity.other.attribute-name {
  color: #c1a101;
}
.entity.other.attribute-name.id {
  color: #78bd65;
}
.meta.class {
  color: #eb3d54;
}
.meta.link {
  color: #eb3d54;
}
.meta.require {
  color: #ef7c2a;
}
.meta.selector {
  color: #eb3d54;
}
.meta.separator {
  background-color: #686b78;
  color: #1c1d21;
}
#selector {
  margin-top: 22px;
  font-style: italic;
  content: "content";
}
.none {
  color: #1c1d21;
}
.markup.bold {
  color: #eb3d54;
  font-weight: bold;
}
.markup.changed {
  color: #eb3d54;
}
.markup.deleted {
  color: #eb3d54;
}
.markup.italic {
  color: #eb3d54;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #ef7c2a;
}
.markup.inserted {
  color: #78bd65;
}
.markup.list {
  color: #eb3d54;
}
.markup.quote {
  color: #eb3d54;
}
.markup.raw.inline {
  color: #78bd65;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #78bd65;
}
.source.php .other.phpdoc {
  color: #848794;
}
.blade.keyword,
.blade.entity,
.blade.punctuation {
  color: #78bd65;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
.an-old-hope-light-modify-ui .tree-view::before {
  background: #4fb4d8;
}
.an-old-hope-light-modify-ui .tree-view .header.list-item,
.an-old-hope-light-modify-ui .tree-view .list-item {
  color: #686b78;
}
.an-old-hope-light-modify-ui .tab-bar .tab::before {
  background: #4fb4d8;
}
.an-old-hope-light-modify-ui .tab-bar .tab .title {
  color: #686b78;
}
.an-old-hope-light-modify-ui .tab-bar .tab.active .title {
  color: #848794;
}
.an-old-hope-light-modify-ui .tab-bar .tab .close-icon {
  color: #4fb4d8 !important;
}
.an-old-hope-light-modify-ui atom-text-editor::shadow .line-number {
  padding-left: 18px !important;
}
.an-old-hope-light-modify-ui .status-added,
.an-old-hope-light-modify-ui .status-added > .list-item {
  color: #78bd65 !important;
}
.an-old-hope-light-modify-ui .status-modified,
.an-old-hope-light-modify-ui .status-modified > .list-item {
  color: #4fb4d8 !important;
}
.an-old-hope-light-modify-ui .status-removed {
  color: #eb3d54 !important;
}
.an-old-hope-light-modify-ui .status-renamed {
  color: #f39959 !important;
}
.an-old-hope-light-modify-ui .status-ignored,
.an-old-hope-light-modify-ui .status-ignored > .list-item {
  color: #51535d !important;
}
.an-old-hope-light-modify-ui .status-bar {
  color: #51535d;
}
.an-old-hope-light-modify-ui .status-bar a,
.an-old-hope-light-modify-ui .status-bar div {
  color: #51535d;
}
.an-old-hope-light-modify-ui .status-bar .deprecation-cop-status {
  color: #f39959;
}
.an-old-hope-light-modify-ui .status-bar .package-updates-status-view {
  color: #78bd65;
}
.an-old-hope-light-modify-ui .settings-view input[type="checkbox"]:checked {
  background-color: #4fb4d8;
}
.an-old-hope-light-modify-ui .settings-view button.selected,
.an-old-hope-light-modify-ui .settings-view .btn.btn-default.selected,
.an-old-hope-light-modify-ui .settings-view .btn.btn-info {
  background: #4fb4d8;
}
.an-old-hope-light-modify-ui .settings-view button.selected:hover,
.an-old-hope-light-modify-ui .settings-view .btn.btn-default.selected:hover,
.an-old-hope-light-modify-ui .settings-view .btn.btn-info:hover {
  background: #79c6e2;
}
.an-old-hope-light-modify-ui .btn.btn-primary {
  background: #4fb4d8;
}
.an-old-hope-light-modify-ui a.link {
  color: #78bd65;
}
.an-old-hope-light-modify-ui a.link:hover {
  color: #78bd65;
}
.an-old-hope-light-modify-ui atom-text-editor[mini].is-focused {
  border-color: #4fb4d8;
  box-shadow: 0 0 0 1px #4fb4d8;
}
.an-old-hope-light-modify-ui .tooltip.top .tooltip-arrow {
  border-top-color: #78bd65;
}
.an-old-hope-light-modify-ui .tooltip.top-left .tooltip-arrow {
  border-top-color: #78bd65;
}
.an-old-hope-light-modify-ui .tooltip.top-right .tooltip-arrow {
  border-top-color: #78bd65;
}
.an-old-hope-light-modify-ui .tooltip.right .tooltip-arrow {
  border-right-color: #78bd65;
}
.an-old-hope-light-modify-ui .tooltip.left .tooltip-arrow {
  border-left-color: #78bd65;
}
.an-old-hope-light-modify-ui .tooltip.bottom .tooltip-arrow {
  border-bottom-color: #78bd65;
}
.an-old-hope-light-modify-ui .tooltip.bottom-left .tooltip-arrow {
  border-bottom-color: #78bd65;
}
.an-old-hope-light-modify-ui .tooltip.bottom-right .tooltip-arrow {
  border-bottom-color: #78bd65;
}
.an-old-hope-light-modify-ui .tooltip .tooltip-inner {
  background: #78bd65;
}
